// components/CommunityPage.js
import React from 'react';
import HikingBuddySignup from './HikingBuddySignup';
import AvailableBuddies from './AvailableBuddies';
import Chat from './Chat';

const CommunityPage = ({ userId }) => {
  return (
    <div className="community-page">
      <h1>Find a Hiking Buddy</h1>

      {/* Hiking Buddy Sign Up Section */}
      <section>
        <h2>Sign up to be a Hiking Buddy</h2>
        <HikingBuddySignup userId={userId} />  {/* Pass userId from props */}
      </section>

      {/* Available Hiking Buddies Section */}
      <section>
        <h2>Available Hiking Buddies</h2>
        <AvailableBuddies />
      </section>

      {/* Chat Section */}
      <section>
        <h2>Chat with a Hiking Buddy</h2>
        <Chat />
      </section>
    </div>
  );
};

export default CommunityPage;
